import React from "react";

let count = 0;

let incNum = ()=>{
    count++;
    console.log("clicking" + count);
}


const Hook = ()=>{
    return(
        <>
          <h3> {count} </h3>
          <button onClick= {incNum}> ADD ME </button>
        </>
    );
}


export default Hook;
